helper::String -> Int -> String
helper [] x = []
helper (s:t:ts) a
    | s == '/' && t == '*' = helper ts (a+1)
    | s == '*' && t == '/' = helper ts (a-1)
    | a == 0 = ""
    | otherwise = helper (t:ts) a

